import React from "react";
import { Link } from "react-router-dom";
import "./Navbar2.css";
const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-content">
          {/* Left side navigation links */}
          <div className="navbar-left">
            <a href="/" className="nav-link">Home</a>
            <a href="/About" className="nav-link">About us</a>
            <a href="/MatchMaking" className="nav-link">Match Making</a>
            <a href="/Blog" className="nav-link">Blog</a>
            <a href="/ContactUs" className="nav-link">Contact us</a>
            <a href="/ChatUI" className="nav-link">Chat</a>
          </div>

          {/* Right side profile and auth links */}
          <div className="navbar-right">
            <a href="/login" className="nav-link auth-link">SignUp/Login</a>
            <a href="/UserProfile" className="nav-link profile-link">Profile</a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
